// ========================================================== faq accordion
$('.quest__item').on('click', function () {
  $(this).addClass('active');
  $(this).find('.quest__answer').slideDown();
})

$('.quest__item-close').on('click', function (event) {
  event.stopPropagation();

  let questItem = $(this).closest('.quest__item');
  questItem.find('.quest__answer').slideUp();
  questItem.removeClass('active');
})
